  display: flex;
  color: #313b3f;
  background: #090a0b;
  width: 100%;
  height: 50px;
  align-items: center;
  padding: 20px;
`;

const StyledAnchor

const Header: FC = () => (
  <StyledHeader>
    <Link href="/">
      <StyledAnchor style={linkStyle}>Home</StyledAnchor>
    </Link>
  </StyledHeader>
